    Game features:
    ~~~~~~~~~~~~~~
    From the board to the monitor, put your negotiation skills to the test
    in Paradox Interactive's take on the classic board game, Diplomacy. Set
    in early 20th century Europe, this PC adaptation brings the power
    struggles of seven mighty nations to life like never before. Its
    abstracted and simple gameplay puts the focus on the need for shrewd
    negotiations and overall strategy.


